    //   keywordsString.append(Object.keys(this.props.data.keywords)[i]);
    // }
    console.log("here");
    console.log(Object.keys(this.props.data.keywords));
    return "hello";
  }

  render() {
    console.log(this.props.data);
    return (
      <div>
        <h1> <b>({this.props.data.number}) {this.props.data.name}</b> | ({this.props.data.credits} Credits)</h1>
        <h3> <b>Subject</b>: {this.props.data.subject} </h3>
        <h4> {this.props.data.description} </h4>
        <h3> <b>Requisites</b>: {this.props.data.requisites} </h3>
        <h4> Keywords: {this.props.data.keywords} and {this.setAllKeywords()} </h4>
      </div>
    )
  }
}

export default Course;
